import React from "react";

const Clothing = ({ label, imageUrl }) => {
  return (
    <>
      <label htmlFor="clothing_item">
        <img src={imageUrl} alt={label} />
        <p>{}</p>
      </label>
      <input type="checkbox" id="clothing_item" />
    </>
  );
};

export default Clothing;
